function SplitQueryString(s) {
    let url = {
        path: s,
    }

    const k = s.match('(.+)?(.+)')
    url.path = k

    return url;
}

async function getIdentifiers(src) {
    let identifiers = {}
    for (let i = 0; i < GetNumPlayerIdentifiers(src); i++) {
        const identifier = GetPlayerIdentifier(src, i);
    
        switch (identifier.split(':')[0]) {
            case 'steam':
                identifiers.steam = webApi.encrypt(identifier.split(':')[1]);
                break;
            case 'license':
                identifiers.license = webApi.encrypt(identifier.split(':')[1]);
                break;
            case 'xbl':
                identifiers.xbl = webApi.encrypt(identifier.split(':')[1]);
                break;
            case 'live':
                identifiers.live = webApi.encrypt(identifier.split(':')[1]);
                break;
            case 'discord':
                identifiers.discord = webApi.encrypt(identifier.split(':')[1]);
                break;
            case 'ip':
                identifiers.ip = webApi.encrypt(identifier.split(':')[1]);
                break;
        }
    }

    return identifiers
}

SetHttpHandler(async (req, res) => {
    let url = SplitQueryString(req.path)
    res.writeHead(200, { 'Content-Type': 'application/json' });

    req.path = url.path
    req.query = url.query

    if (routes[req.path]) {
        HandleRoute(req, res)
    }

    if (req.path[0] === '/') {
        res.send(webApi.encrypt(JSON.stringify({status: 'online'})))
    } else if (req.path[0] === '/players'){
        const players = fivem.getAllPlayers()
        res.send(webApi.encrypt(JSON.stringify(players)))
    } else if(req.path[0] === '/getPlayerCount') {
        res.send(webApi.encrypt(JSON.stringify(fivem.getPlayerCount())))
    } else if (req.path[0] === '/announce') {
        //check if its a post request
        if (req.method === 'POST') {
            const verificationKey = webApi.decrypt(req.headers.verificationKey)

            if (verificationKey === config.verificationKey) {
                emitNet('chat:addMessage', -1, {
                    args: [
                        prefix + ' ' + req.headers.message
                    ]
                })
                res.send(webApi.encrypt(JSON.stringify({status: 'success'})))
            } else {
                res.send(webApi.encrypt(JSON.stringify({status: 'error'})))
            }
        } else {
            res.send(webApi.encrypt(JSON.stringify({status: 'error'})))
        }
    } else if (req.path[0] === '/report') {
        if (req.method === 'POST') {
            const verificationKey = webApi.decrypt(req.headers.verificationKey)

            if (verificationKey === config.verificationKey) {
                const allPeds = await fivem.getAllPlayers()
                //for each object in the array
                for (const [key, value] of Object.entries(allPeds)) {
                    if (IsPlayerAceAllowed(key, 'staff.viewReports') === 1) {
                        emitNet('chat:addMessage', key, {
                            args: [
                                prefix + ' ' + req.headers.message
                            ]
                        })
                    }
                }
            } else {
                res.send(webApi.encrypt(JSON.stringify({status: 'error'})))
            }
        }
    } else if (req.path[0] === '/screenshot') {
        if (req.method === 'POST') {
            const verificationKey = webApi.decrypt(req.headers.verificationKey)
            if (verificationKey === config.verificationKey) {
                const allPeds = await fivem.getAllPlayers()
                //for each object in the array
                for (const [key, value] of Object.entries(allPeds)) {
                    //get the license of the player
                    const identifiers = await getIdentifiers(key)
                    const license = webApi.decrypt(identifiers.license)

                    //check if the license is the same as the one in the request
                    if (license === webApi.decrypt(req.headers.license)) {
                        //take screenshot
                        requestClientScreenshot(key, {
                            fileName: 'cache/screenshot' + license + '.png',
                        }, function(err, data) {
                            const file = path.resolve(__dirname + '/cache/screenshot' + license + '.png')
                            
                            imgToBase64(file).then(data => {
                                res.send(JSON.stringify({status: true, data: `${data}`}))
                            }).catch(err => {
                                res.send(webApi.encrypt(JSON.stringify({status: false})))
                            })
                        });
                    } else {
                        res.send(webApi.encrypt(JSON.stringify({status: false})))
                    }
                }
            } else {
                res.send(webApi.encrypt(JSON.stringify({status: 'error'})))
            }
        }
    }
})
   
