RegisterCommand("ban", async function(src, args, rawCommand) {
    if (args[0] === null || args[0] === undefined || args[1] === null || args[1] === undefined || args[2] === null || args[2] === undefined) {
        emitNet("client-sendMessage", src, prefix + ' ' + 'Invalid arguments. Please use /ban [ID] [Duration] [Duration Type] [Reason]');
        return;
    }

    //If anyone reads this (dunno if this will get leaked), I am so lazy.
    if (GetPlayerPing(args[0]) === 0) {
        emitNet("client-sendMessage", src, prefix + ' ' + 'The player you are trying to ban is not online.');
        return;
    }

    //check if args 1 is a number
    if (isNaN(args[1])) {
        emitNet("client-sendMessage", src, prefix + ' ' + 'Please provide a valid number.');
        return;
    }

    //check if args 2 is a string
    if (typeof args[2] !== 'string') {
        emitNet("client-sendMessage", src, prefix + ' ' + 'Please provide a valid duration type.');
        return;
    }

    if (args[2] === 'h' || args[2] === 'd' || args[2] === 'w' || args[2] === 'm' || args[2] === 'y') {
        const playerIdentifiers = await getIdentifiers(args[0])
        const staffIdentifiers = await getIdentifiers(src)
    
        axios.post(`${config.webUrl}/api/fivem/player/punishment`, {
            serverId: config.serverId,
            playerIdentifiers: await getIdentifiers(args[0]),
            staffIdentifiers: await getIdentifiers(src),
            type: 'ban',
            duration: args[1],
            durationType: args[2],
            reason: webApi.encrypt(args.slice(1).join(' '))
        }).then(function (response) {
            if (response.data.status) {
                DropPlayer(parseInt(args[0]), 'You have been banned from the server. Reason: ' + args.slice(3).join(' ') + '. You cannot join back to the server. | Date: ' + moment().format('MMMM Do YYYY, h:mm:ss a'))
                emitNet("client-sendMessage", src, prefix + ' ' + response.data.message);
            } else {
                emitNet("client-sendMessage", src, prefix + ' ' + response.data.err);
            }
        }).catch(function (error) {
            console.log(error)
            emitNet("client-sendErrorMessage", src, prefix + ' ' + error.data);
        })
    } else {
        emitNet("client-sendMessage", src, prefix + ' ' + 'Please provide a valid duration type. (d, h, m, y)');
    }
})

